export default function Card(props) {

   const {name, species, gender, onClose} = props
   return (
      <div>
         <button onClick={onClose}>X</button>
         <h2>{name}</h2>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         <img  src={props.image} alt={name} />
      </div>
   );
}
